script: |
  super -f text -I q4527.spq | sort > q4527.out

inputs:
  - name: q4527.spq
    data: |
      SELECT DISTINCT - 99 + col2 FROM tab1 (FORMAT parquet) WHERE NOT ( ( - - col0 ) + - 96 IN ( - 33 * 6 + + - col1 + + col1 - - 99 ) );
  - name: tab1

outputs:
  - name: q4527.out
    data: |
      -3
      -31
      -40
